var React = require("react");
var marked = require('marked');
var axios = require('axios');
export default class Dashboard extends React.Component {
  render() {
    let answered = 0;
    let unanswered = 0;
    let questioner = [];
    let topics=[];
    let idenCheck = [];
    let idenCheck2 = [];
    let idenCheck3= [];
    let {data} = this.props;
        data.forEach(item=>{
            if(!item.answer){
                unanswered+=1;
            } else if(item.answer){
                if(!idenCheck.includes(item.questionid)){
                    idenCheck.push(item.questionid);
                    answered+=1;
            }
            }
        })
        data.forEach(item=>{
            if(!idenCheck2.includes(item.questionid)){
            idenCheck2.push(item.questionid);
            questioner.push(item.username);
            topics.push(item.topic);
            }

        })




const countObj = (arr) => {
    let count = {};
    for(let i=0;i<arr.length;i++){
        let num = arr[i];
        count[num] = count[num] ? count[num] + 1 : 1
    }
    return count;
}

questioner = countObj(questioner);
topics= countObj(topics);

let questionerData = Object.values(questioner).join(',');
let questionerLabel = Object.keys(questioner).join(',');

let topicsData = Object.values(topics).join(',');
let topicsLabel = Object.keys(topics).join(',');

let date = new Date().toLocaleDateString();

let questionsList = data.map(item=>{
    if(!item.answer){
    if(item.markdown){
            item.question=marked(item.question);
            return (<li className="list-group-item font-weight-lighter text-wrap"><a href={`/questions/${item.questionid}`}><div dangerouslySetInnerHTML={{__html: item.question}}></div></a>
                <footer class="blockquote-footer font-weight-strong">Topic: {item.topic}</footer>
        <footer class="blockquote-footer font-weight-light">Popularity: {item.vote}</footer>
                </li>)
        } else {
        return (<li className="list-group-item font-weight-lighter text-wrap"><a href={`/questions/${item.questionid}`}>{item.question}</a>
            <footer class="blockquote-footer font-weight-strong">Topic: {item.topic}</footer>
        <footer class="blockquote-footer font-weight-light">Popularity: {item.vote}</footer>
            </li>)
    }
}
})

let verifyList = data.map(item=>{
    if(!idenCheck3.includes(item.questionid)){
        idenCheck3.push(item.questionid)
    if(item.answer && !item.verified){
        if(item.markdown){
            item.question=marked(item.question);
