                <input type="checkbox" id="markdown" name="markdown" value="true" /> Markdown required <br /> <br />
                    <input type="submit" value="Submit" style={{marginLeft:'470px'}} class="btn btn-primary"/>
                </form>
                </div>
                </div>
                </body>
            </html>
            )
    }
}

